pragma solidity 0.4.24;
import "../node_modules/zeppelin-solidity/contracts/token/ERC20/StandardToken.sol";


contract WBLCoin is StandardToken {
    string public name = "BizCoinT"; 
    string public symbol = "bcrT"; //통화단위
    uint public decimals = 8; //자리수
    uint public INITIAL_SUPPLY = 200000000 * (10 ** decimals); //초기 공급량
 
    //생성자
    constructor() public {
        totalSupply_ = INITIAL_SUPPLY;
        balances[msg.sender] = INITIAL_SUPPLY;
    }
}
